E_D("replace into `qb_fenlei_content_6` values('3','17','25','1','型号：Thinkpad E30（0492-2ZC）\r\n颜色：热力红（亮光面）\r\nCPU： SU4100(1.30GHz)\r\n内存： 2GB\r\n硬盘：320GB\r\n显示芯片：Intel GMA 4500MHD\r\n无线网卡：ThinkPad BGN （支持802.11b/g/n无线协议）\r\n网卡：1000Mbps以太网卡\r\n触摸板：多点触摸板 \r\n指点杆：Trackpoint指点杆\r\n摄像头像素： 130万 \r\n屏幕：13.3英寸 宽屏16：9 1366 x 768\r\n续航时间： 电池29Wh 5小时 看电影3-4个小时。\r\n具体参数可以到网上看看，京东现在的价钱是5300的样子。\r\n用了半年，发票保修单一应俱全，还有半年的质保期！\r\n此本保护还好 外观无任何磨损 ，已装WIN7旗舰版！\r\n上网办公 游戏娱乐 在线看看电影， 都不在话下，低电压CPU，续航能力超强。而且特别轻，1.64KG的样子。比较适合女孩子用。\r\n想要的可以跟我联系，非诚勿扰！谢谢！\r\n','44','9成新','4343','1');");
E_D("replace into `qb_fenlei_content_6` values('4','28','25','1','个人转让惠普高配游戏笔记本,机器95成新平时很少也用，配置：14寸镜面炫彩宽屏，双核1.7（速度很快），1G内存，160G硬盘，高性能256M显卡，无线上网，DVD刻录，多合一读卡器，轻触控制键，奥特蓝星HIFI高级音响（音响很好）。\r\n\r\n此本玩游戏一点问题都没有，什么魔兽，极飞，使命召唤等都很好运行，像地下城，诛仙，穿越火线等更不在话下！！！不论玩游戏办公这本完全可以胜任！\r\n机器没有修过，买时贴的膜，刚揭下来跟新的一样！','543','9成新','5435','2');");
