E_D("replace into `qb_fenlei_content_6` values('6','30','25','1','我的本本是惠普的CQ40，非常的漂亮，买了不到1个月，成色没得说，99.9成新。\r\n外观十分的漂亮，黑色的钢琴华丽烤漆表面上镶嵌着一个银色的惠普的标志，很高贵很华丽。\r\n本本内部是珍珠银白色的华美掌托包围键盘，很漂亮很高贵，黑色的巧克力防水防尘舒适键盘，看上去更是漂亮至极，本本多处的五彩指示灯的绚丽闪烁令本本华丽无比。本本的屏幕是14.1寸的LED黑晶透亮宽屏，看上去非常的亮，视觉效果很好。\r\n本本外观是极其的漂亮。\r\n电脑的处理器CPU是 Inter 酷睿2双核 2.0HZ 速度非常的快的。\r\n内存 1G的\r\n硬盘是 250G 超级高速大硬盘\r\n显卡是 ATI的独立显卡512MB玩游戏作图看电影什么的视觉效果非常好\r\n光驱是DVD刻录光驱 听朋友说可以自己刻录光盘的\r\n电池3个小时以上 本本散热非常好\r\n本本内置高清摄像头 无线网卡 蓝牙 HDMI高清数字接口 多功能读卡器 等\r\n我的国家正式发票 保修卡 原装电脑包 鼠标 适配器 等都在，买了没1个月，电脑各方面非常好，2年的全国联保。\r\n','434','9成新','54354','1');");
E_D("replace into `qb_fenlei_content_6` values('7','31','25','1','电脑型号是IBM T61P高端商务笔记本，里外几乎没有磨损，可以说和新的没有什么区别，999成新没有问题。\r\n笔记本内有的商务功能有：蓝牙，集成指纹识别器，安全芯片，5合1读卡器，2G迅盘{加速拷贝资料的速度，比普通的电脑要快近一倍}，无线上网卡，1394数码接口，防水键盘等等。\r\n笔记本购买到目前为止8个月时间，本机总共全国保修3年，现在还有2年零4个月时间。发票，保修卡等保修手续全部都有。质量可以完全放心，可以当面随便检查。\r\n笔记本我平时只是用来办公上网使用[其实非常的浪费]，出售的原因就是因为闲置。\r\n要是有喜欢玩游戏或者作图设计的朋友我的电脑真是首选。毕竟这么高的配置已经相当高了。\r\n处理器：迅驰4代的技术，英特酷睿2双核T8300的，主频大小2.4HZ，采用的是先进的45纳米技术。\r\n处理文件的速度非常的快。电池基本上没有用，现在单次充满电能用3小时多。\r\n内存：原装的2代 2G内存，最高支持4G扩展。 硬盘：高转速320G超大硬盘。\r\n显卡：Nvidia FX570M的专业独立显卡。显卡大小512MB的。无论是玩游戏作图设计都没有问题。\r\n光驱：DVD带双层刻录的DVD光驱，能刻录VCD,CD,DVD等各种光盘。\r\n笔记本屏幕是15.4寸的16：9高分宽屏，屏幕是180度角度清晰可见的U屏。分辨率是1680*1050.\r\n我的本本大概也就这些参数了，有喜欢小黑商务本的朋友不妨可以来看看。\r\n本本的配件有：电源适配器，鼠标，发票，保修卡原装双肩背包{单这个背包至少需要200多元}等所有免费一起随电脑赠送。\r\n','43','9成新','5435','2');");
E_D("replace into `qb_fenlei_content_6` values('8','34','26','1','全新的手机，行货价3850元，除了打开盒子拍了以下的照片，机器都没有拆封，可检查电池触点。别人送的行货，因为不习惯WM系统，所以便宜出售。WM6.5系统，大屏幕触控，非常大气时尚。手感很好。与专业导航设备公司Garmin的联合品牌Garmin-Asus推出的第二款以专业导航功能为卖点的机型，其余详细介绍请上网查询。\r\n','2500','9成新','3000','2');");
