E_D("replace into `qb_fenlei_content_6` values('10','36','30','1','个人的皮靴，42号的或称27厘米，牌子是金典鼎豪。断断续续穿了一年，觉得顶脚有点小，今年又买大一号的皮靴了，这双鞋就不穿了，觉得还不算旧，扔了可惜，转让给需要的不讲究的人吧，10元就转让。（如不用花钱可用旧手机交换也行，手机有点毛病有点问题也可交换）。有意者电话短信邮箱都可联系，地点也可商量','2','9成新','10','2');");
